import axios from "axios";

const eventRemove = (accessToken: string, eventIds: number[]) => {
    return axios.post("https://journey-timeline-backend.up.railway.app/eventremove", {
        headers: {
            Authorization: `Bearer ${accessToken}`
        },
        eventIds
    })
        .then((res) => {
            return res.data
        })
        .catch((err) => {
            return null;
        })
}

export default eventRemove;
